import { FormControl, FormControlLabel, FormControlLabelText, Input, InputField } from '@gluestack-ui/themed';
import { Box, VStack } from '@gluestack-ui/themed';


const RegisterView = () => {
    return <Box justifyContent="center" alignItems="center">
        <VStack>
            <FormControl size={"md"} isDisabled={false} isRequired={true}>
                <FormControlLabel>
                    <FormControlLabelText> User name</FormControlLabelText>
                </FormControlLabel>
                <Input mt={"$5"} w={"$3/4"}>
                    <InputField type="password" defaultValue="" placeholder="Name"  />
                </Input>
            </FormControl>
        </VStack>
    </Box>;
};
export default RegisterView;
